/**
 * @param {number} limit
 * @param {number[][]} queries
 * @return {number[]}
 */
function queryResults(limit, queries) {
	let balls = new Map()
	let colors = new Map();
	let results = new Array(queries.length);

	for (let i = 0; i < queries.length; i++) {
		let ball = queries[i][0];
		let newColor = queries[i][1];

		// existing ball only
		if(balls.has(ball)){
			let oldColor = balls.get(ball);
			// decrease previous color's count
			colors.set(oldColor, (colors.get(oldColor) ?? 0) - 1)
			if(colors.get(oldColor)===0) {
				colors.delete(oldColor);
		}
		}

		// update ball color
		balls.set(ball, newColor);
		// increase new color's count
		colors.set(newColor, (colors.get(newColor) ?? 0) + 1)

		results[i] = colors.size;
	}

	return results;
};

